import React from "react";
import "../footer/Footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <div className="container">
        <div className="row">
          <div className="col-lg-4">
            <div className="lastlinks">
            <ul className="contact">
              <li></li>
              <li></li>
              <li></li>
            </ul>
            </div>
          </div>
          <div className="col-lg-4"><div className="dev">by<span>ZIAD ADEL</span></div> </div>
          <div className="col-lg-4"><div className="thanks">ENG/Mo</div></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
